const Modal = (prop) => {
    const setModal = prop.setModal;
    const handleClick = () => {
        setModal(false);
    }
    return (  
        <>
            <div className="bg-zinc-100 opacity-50  fixed inset-0 z-50">
                <div className="flex h-screen justify-center items-center">
                    <div className="border-2 border-blue-800 rounded-lg bg-white p-2 opacity-100 ">
                        <p>Modal</p>
                        <button onClick={handleClick}> close</button>
                    </div>
                </div>
            </div>
        </>
    );
}
 
export default Modal;
